INSERT INTO public.news (id, title, text, publish_date, images) VALUES (1, 'График поставок с мебельных фабрик', '<p>Уважаемые клиенты, график прихода машин на наш склад для вашего удобства:</p><p><br></p><p><br></p><ul><li>МФ "LEKO"- 2 декабря 2024г / 16 декабря 2024г / 23 декабря 2024г</li></ul><p><br></p><p><br></p><ul><li>МФ "ЛИНАУРА" - 9 декабря 2024г</li></ul><p><br></p><p><br></p><ul><li>МФ "ВНК" - 2 декабря 2024г</li></ul><p><br></p><p><br></p><ul><li>МФ "ROSTOK MEBEL" - 12 декабря 2024г</li></ul><p><br></p><p><br></p><ul><li>МФ "УЮТ" - 9-13 декабря 2024г</li></ul><p><br></p><p><br></p><ul><li>МФ "ТИМЕР" - нет приходов до конца года</li></ul><p><br></p><p><br></p><ul><li>МФ "RINNER"- нет приходов до конца года</li></ul><p><br></p><p><br></p><ul><li>МФ "NTKO"- нет приходов до конца года</li></ul><p><br></p><p><br></p><ul><li>МФ "FORT"- нет приходов до конца года</li></ul>', '2024-10-31 09:40:51.118707+00', NULL);
INSERT INTO public.news (id, title, text, publish_date, images) VALUES (2, 'Новая гостиная "Хлоя"', '<p>Дорогие наши клиенты, рады представить вашему вниманию новинку от фабрики "ВНК" гостиная "Хлоя"!</p><p>Подробности у наших менеджеров!</p>', '2024-11-01 11:27:35.490923+00', NULL);
INSERT INTO public.news (id, title, text, publish_date, images) VALUES (3, 'МФ РИННЭР акция ТИФФАНИ осень 2024 ДАРИМ ПОДАРКИ', '<p>Представляем новую акцию на серию Тиффани.</p><p>&nbsp;</p><p>При заказе любых модулей серии Тиффани от 70000 руб. подарок в размере 10% от стоимости заказа, который Вы можете выбрать себе из складских остатков ассортимента МФ Риннэр.</p><p>&nbsp;</p><p>Если стоимость выбранного товара в подарок превышает сумму скидки, то скидка вычитается из стоимости товара. </p><p>Если стоимость выбранного товара меньше скидки, то остаток скидки НЕ переносится на следующий заказ. Такой заказ необходимо оформлять отдельной накладной и в нее же добавлять подарочные позиции.</p><p>Сроки действия акции до 30.11.2024г</p><p>&nbsp;</p><p>Скидка&nbsp;15%&nbsp;на модули Тиффани 2022 от любой суммы заказа.</p>', '2024-11-26 11:19:13.260152+00', NULL);


