Стол-книга СТ-1М на металлокаркасе – довольно узкий в сложенном виде, легко превращается в полноценный обеденный стол в разложенном состоянии. Столешница крепится на легкий и прочный металлический каркас, обеспечивая надежность и устойчивость конструкции.



Такая модель оптимально подходит, как для малогабаритных, так и для полнометражных помещений. Практичность стола-книги заключается в экономии пространства и возможности размещения узкого изделия в любом уголке квартиры и достаточно несложная транспортировка мебели. Качество исполнения и надежность фурнитуры неизменно вызывает положительные отзывы наших клиентов.



