INSERT INTO public.products (id, code, vendor_code, full_name, price_individual, price_entity, discount_price_individual, discount_price_entity, balance_in_stock1, balance_in_stock2, category_id, subcategory_id, manufacture_id, description, weight, width, height, depth, color_id, bestseller, new, create_date, modify_date, images) VALUES (696, 'Т0000021605', 'Т0000021605', 'Стол-книга СТ-1М на металлкаркасе Венге/Дуб молочный', 4400.00, 0.00, NULL, NULL, 6, 6, 8, 4, 8, 'Стол-книга СТ-1М на металлокаркасе – довольно узкий в сложенном виде, легко превращается в полноценный обеденный стол в разложенном состоянии. Столешница крепится на легкий и прочный металлический каркас, обеспечивая надежность и устойчивость конструкции.

