плавность хода.
Такое изделие очень удобно для небольших помещений. Угол раскачивания зависит от размеров кресла, длины элементов, из которых состоит каркас, а также от того, какие крепления были использованы в производстве.
Кресло «Лама» из линейки качалок подарит истинное чувство уюта и гармонии.
Компактное, но очень удобное кресло будет выглядеть органично в любом интерьере. ', 16000, 650, 1050, 800, 103, false, false, '2024-11-13 12:22:51.784098+00', '2025-01-09 09:32:29.027713+00', NULL);
