Модель с размерами 1000х2185х440мм прекрасно впишется в любую обстановку и подчеркнет индивидуальную составляющую вашего дома. Благодаря оригинальным дизайнерским решениям, наша мебель станет украшением любой спальни, домашней библиотеки, прихожей или гостиной.', NULL, 1000, 2185, 440, 105, false, false, '2024-11-13 12:22:52.323931+00', '2025-01-09 09:32:31.447189+00', NULL);
