INSERT INTO public.products (id, code, vendor_code, full_name, price_individual, price_entity, discount_price_individual, discount_price_entity, balance_in_stock1, balance_in_stock2, category_id, subcategory_id, manufacture_id, description, weight, width, height, depth, color_id, bestseller, new, create_date, modify_date, images) VALUES (1258, 'Т0000022808', 'Т0000022808', 'Кресло "Манго" ткань Невада Охра', 13800.00, 0.00, NULL, NULL, 4, 4, 12, 44, 9, 'Сегодня мягкая мебель для дома, в частности кресла, представлены моделями в разных стилистических направлениях.
