INSERT INTO public.products (id, code, vendor_code, full_name, price_individual, price_entity, discount_price_individual, discount_price_entity, balance_in_stock1, balance_in_stock2, category_id, subcategory_id, manufacture_id, description, weight, width, height, depth, color_id, bestseller, new, create_date, modify_date, images) VALUES (1346, 'Т0000022450', 'Т0000022450', 'Тиффани Спальня Модуль No22 Шкаф с зеркалом четырехдверный БЕЛЫЙ ТЕКСТУРНЫЙ', 31995.00, 0.00, NULL, NULL, 2, 2, 6, 36, 2, 'Особенности изделия:
1. Внутреннюю компановку шкафа можно собрать на левую или правую сторону.
2. Зеркальные фасады с фацетом по периметру.
3. Зеркала оклеены противоосколочной пленкой безопасности (если вдруг зеркало разобьется, оно не рассыплется).
4. Фасады МДФ украшены ручками с кристаллами.
5. В левой секции две штанги под короткие вещи и одна жесткая полка.
6. В правой - две мини секции: с вешалом для длинных вещей и с 4 полками (две нижние и верхняя полки - съемные; третья снизу - жесткая), эти мини секции объединены общей верхней жесткой полкой.
7. Шкаф очень вместителен и заменяет собой обычную шкафную группу, а также прост в сборке, в отличие, например, от шкафа-купе.', 163000, 1800, 2220, 510, 78, false, false, '2024-11-13 12:22:54.241093+00', '2025-01-09 09:32:41.565933+00', NULL);
