6. Фигурные опоры высотой 100 мм.
7. Вместе с двумя Пеналами М01 (собранными один на левую, другой на правую сторону) комод составляет законченную мебельную композицию для гостиной комнаты.', 68000, 1350, 920, 495, 115, false, false, '2024-11-13 12:22:54.378632+00', '2025-01-09 09:32:42.33551+00', NULL);
INSERT INTO public.products (id, code, vendor_code, full_name, price_individual, price_entity, discount_price_individual, discount_price_entity, balance_in_stock1, balance_in_stock2, category_id, subcategory_id, manufacture_id, description, weight, width, height, depth, color_id, bestseller, new, create_date, modify_date, images) VALUES (1068, 'Т0000020902', 'Т0000020902', 'Кровать КД-1.8 (подъёмный мех) Венге/Дуб молочный', 8130.00, 60000.00, NULL, NULL, 8, 8, 6, 31, 8, 'Односпальная кровать оборудованная подъемным механизмом станет отличным вариантом для небольшой спальни или детской комнаты. Размер спального места 2000х900 мм с ящиком для белья, в котором удобно хранить постельные принадлежности и межсезонные вещи.

Размеры кровати 950х700х2035мм прекрасно подойдут, как для тинейджера, так и для взрослого человека, поэтому такая мебель пользуется спросом у покупателей. И это вполне объяснимо: стильный дизайн, надежная фурнитура и современные материалы стали визитной карточкой нашей продукции.

Механизм поднятия упрощает доступ к основанию, в котором хранятся нужные вещи. Кровать «КД-1,8» станет отличным дополнением детской и обеспечит комфортные условия для сна и отдыха.', NULL, 950, 700, 2035, 38, false, false, '2024-11-13 12:22:52.355226+00', '2025-01-11 11:21:37.826808+00', NULL);
INSERT INTO public.products (id, code, vendor_code, full_name, price_individual, price_entity, discount_price_individual, discount_price_entity, balance_in_stock1, balance_in_stock2, category_id, subcategory_id, manufacture_id, description, weight, width, height, depth, color_id, bestseller, new, create_date, modify_date, images) VALUES (538, 'Т0000020237', 'Т0000020237', 'Кресло "Импульс" Орех, ткань Невада шоколад (в тон)', 16000.00, 16000.00, NULL, NULL, 1, 1, 12, 44, 9, 'Более современная модель качалок – это кресло с маятниковым механизмом. Оно состоит их неподвижного основания, напоминающего небольшие ножки стула, и подвижного сидения, оснащенного маятниковым механизмом. Сиденье соединяется с устойчивым основанием при помощи подшипников, чтобы обеспечить легкость,
плавность хода.
Такое изделие очень удобно для небольших помещений. Угол раскачивания зависит от размеров кресла, длины элементов, из которых состоит каркас, а также от того, какие крепления были использованы в производстве.
Кресло «Импульс» из линейки качалок подарит истинное чувство уюта и гармонии.
Компактное, но очень удобное кресло будет выглядеть органично в любом интерьере. ', NULL, 650, 1050, 800, 83, false, false, '2024-11-13 12:22:48.718103+00', '2025-01-13 08:36:59.179137+00', NULL);
INSERT INTO public.products (id, code, vendor_code, full_name, price_individual, price_entity, discount_price_individual, discount_price_entity, balance_in_stock1, balance_in_stock2, category_id, subcategory_id, manufacture_id, description, weight, width, height, depth, color_id, bestseller, new, create_date, modify_date, images) VALUES (537, 'Т0000020236', 'Т0000020236', 'Кресло "Импульс" Орех, ткань Невада латте (в тон)', 16000.00, 16000.00, NULL, NULL, 2, 2, 12, 44, 9, 'Более современная модель качалок – это кресло с маятниковым механизмом. Оно состоит их неподвижного основания, напоминающего небольшие ножки стула, и подвижного сидения, оснащенного маятниковым механизмом. Сиденье соединяется с устойчивым основанием при помощи подшипников, чтобы обеспечить легкость,
плавность хода.
Такое изделие очень удобно для небольших помещений. Угол раскачивания зависит от размеров кресла, длины элементов, из которых состоит каркас, а также от того, какие крепления были использованы в производстве.
