INSERT INTO public.products (id, code, vendor_code, full_name, price_individual, price_entity, discount_price_individual, discount_price_entity, balance_in_stock1, balance_in_stock2, category_id, subcategory_id, manufacture_id, description, weight, width, height, depth, color_id, bestseller, new, create_date, modify_date, images) VALUES (227, 'Т0000022014', 'Т0000022014', 'Кухня Прованс 2.8 м (с карнизом) Б Белое дерево / Венге', 41530.00, 41530.00, NULL, NULL, 2, 2, 2, 2, 8, 'Кухонный гарнитур "Прованс» 2,8 метра" – это уникальный и гармоничный стиль, идеально вписывающийся в интерьер городской квартиры, загородного коттеджа или дачного домика. Романтичная стилистика кухни наполнит помещение радостной энергией и душевным теплом, вдохнет в комнату много света и воздуха. Корпус из ЛДСП и фасад из МДФ белого цвета, также должен преобладать в цвете стен и текстиля.

Основа этого интерьерного стиля – цвет, который наполняет пространство ощущением свободы и вызывает жизнерадостные ассоциации. Мебельный гарнитур включает самые нужные для кухни предметы: навесные и напольные конструкции, столешницу, стол, мойку и сушилку для посуды. Дизайн стиля прованс предполагает наличие изящных деталей, красивого текстиля и цветов в вазе.

Каждый предмет мебели для кухни имеет свое назначение. В зоне ответственности хозяйки домашнего очага – большое пространство, которое она может обустроить по своему вкусу. Модель в деревенском стиле позволит почувствовать очарование окружающей вас обстановки и подарит прелестную возможность сделать кухню центром семейного мироздания.', NULL, 2800, 2100, 600, 49, false, false, '2024-11-13 12:22:46.510473+00', '2025-01-20 03:47:01.998624+00', NULL);


